import {
  Container,
  MyLocation,
  City,
  Temperature,
  Description,
  Location,
  LocationWeather,
  WeatherWidgets,
  WeatherForecast,
} from './WeatherSection.styled';

function WeatherSection({ weather }) {
  return (
    <Container>
      <LocationWeather>
        <MyLocation>My Location</MyLocation>
        <City>{weather.name}</City>
        <Temperature>{Math.trunc(weather.main.temp)}Â°</Temperature>
        <Description>{weather.weather[0].description}</Description>
        <Location>
          H:{Math.trunc(weather.coord.lat)} L:{Math.trunc(weather.coord.lon)}
        </Location>
      </LocationWeather>
      <WeatherWidgets>
        <WeatherForecast></WeatherForecast>
        <Sunri></Sunri>
      </WeatherWidgets>
    </Container>
  );
}

export default WeatherSection;
